import Theme from './Theme'

const Contact = () => {
    return(
        <div id='contact'>
            <Theme 
            titleBoxStyle='contact-title-box'
            titleStyle='contact-title'
            titleValue='CONTACT ME'
            />
        </div>
    );

}


export default Contact;
